import React from "react";

export default function Home(){
    return (
        <>
            <h1 id="title">Welcome to the future</h1>
            <h2 id="subtitle">The Macroeconomic DAO</h2>

            <h3>Millions of users can spend <br />
            billions on their interests</h3>
        </>
    );
}
